import React from "react";
import { useEffect } from "react";
import { useState } from "react";

function App() {

    const[noaa, setNoaa] = React.useState({})
    const[page, setPage] = React.useState("datasets")

    function fetchNoaa() {
        
        fetch(`{url:https://www.ncei.noaa.gov/cdo-web/api/v2/${page}, headers: {token:gwomPlwFVOzLJLiCZLQGDAqevULFmWlv}}`)
            .then(res => res.json())
            .then(data => setNoaa(data))
            .then(console.log(noaa))
        //token -  gwomPlwFVOzLJLiCZLQGDAqevULFmWlv
    }


    React.useEffect(
        fetchNoaa,
        []
    )//end fetch method
    return (
        <div className="container">
            <h1>Hello World</h1>
        </div>
    )
}//end component

export default App;
